CREATE TABLE persons(
   id               INTEGER  NOT NULL PRIMARY KEY 
  ,topColor         VARCHAR(7) NOT NULL
  ,bottomColor      VARCHAR(7) NOT NULL
  ,ageRange         VARCHAR(2) NOT NULL
  ,queueStartTime   DATETIME  NOT NULL
  ,accessoriesList  DATETIME  NOT NULL
  ,queueEndTime     DATETIME  NOT NULL
  ,queueID          INTEGER  NOT NULL
  ,serviceStartTime DATETIME 
  ,serviceEndTime   DATETIME 
  ,serviceRegionId  INTEGER 
);
